import unittest
import geopandas as gpd
import pandas as pd
import os
from urbanworm import UrbanDataSet

img =  ""



class TestUrbanWorm(unittest.TestCase):
    """Tests for `samgeo` package."""
    def setUp(self):
        self.dataset = UrbanDataSet(image = img)
        self.dataset.bbox2Buildings((-83.235572,42.348092,-83.235154,42.348806))
    def test_oneImgChat(self):
        system = '''
            Given a top view image, you are going to roughly estimate house conditions. Your answer should be based only on your observation. 
            The format of your response must include question, answer (yes or no), explaination (within 50 words)
        '''
        prompt = '''
            Is there any damage on the roof?
        '''
        out = self.dataset.oneImgChat(system=system, prompt=prompt)
        self.assertTrue(isinstance(out, dict))
    def test_loopImgChat(self):
        imgs = [img for i in range(3)]
        self.dataset.imgs = imgs
        self.dataset.base64Imgs = imgs
        system = '''
            Given a top view image, you are going to roughly estimate house conditions. Your answer should be based only on your observation. 
            The format of your response must include question, answer (yes or no), explaination (within 50 words)
        '''
        prompt = '''
            Is there any damage on the roof?
        '''
        out = self.dataset.loopImgChat(system=system, prompt=prompt, output_df=True, saveImg=False)
        self.assertTrue(isinstance(out, pd.DataFrame))
    def test_loopUnitChat(self):
        self.dataset.units = self.dataset.units.iloc[0:1]

        system = '''
            Given a top view image or street view images, you are going to roughly estimate house conditions. 
            Your answer should be based only on your observation. 
            The format of your response must include question, answer (yes or no), explaination (within 50 words) for each question.
        '''

        prompt = {
            'top': '''
                Is there any damage on the roof?
            ''',
            'street': '''
                Is the house occupied?
                Is any window broken or boarded?
                Is the door missing or boarded?
            '''
        }

        self.dataset.loopUnitChat(system=system, prompt=prompt, type='top', epsg=2253)
        out = self.dataset.to_gdf()
        self.assertTrue(isinstance(self.dataset.results, dict))
        self.assertTrue(isinstance(out, gpd.GeoDataFrame))
